import {LoginFormComponent} from './Components/LoginFormComponent';
import {
    BrowserRouter as Router,
    Switch,
    Route,

  } from "react-router-dom";

export class AuthPage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            isError: false,
            email: '',
            password: ''
        }
    }

    render() {
        return (
            <div id="mainDiv">
